import React, {useState} from "react";

function Note(props){
    const [isHovering, setIsHovering] = useState(false);

    const handleMouseOver = () => {
        setIsHovering(true);
    };

    const handleMouseOut = () => {
        setIsHovering(false);
    };
    return(
        <div className="note">
            <h1 onMouseOver={handleMouseOver} onMouseOut={handleMouseOut}>{isHovering ? props.content : props.title}</h1>
        </div>
    );
}

export default Note;
